import React from 'react'
import axios from 'axios'
import { connect } from 'react-redux'
import { useHistory, Link } from "react-router-dom"

class ArticlesList extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      list: []
    };
  }

  getUsersArticles() {
    const list = []
    axios.get('/api/v1/articles',{})
    .then(res => {
      const data       = res.data
      let profile_pc;
      data.articles.forEach( (article, i) => {
        if(article.profile_pc){
          profile_pc = article.profile_pc
        }else{
          profile_pc = "/assets/def.png"
        }

        list.push( 
          <div key={article.id} className="border border-light p-2 mb-3">
            <div className="d-flex align-items-start">
              <img className="me-2 avatar-lg rounded-circle" src={profile_pc} alt="image"/>
              <div className="w-100">
                <h5 className="m-0">{article.user_nm}</h5>
                <p className="text-muted"><small>{article.publish_date}</small></p>
              </div>
            </div>
            <h2>{article.title}</h2>
            <h4>{article.content}</h4>
            <div className="mt-2">
              <Link className="btn btn-sm btn-link text-muted" to={`/articles/${article.id}`}>
                <i className="mdi mdi-reply"></i> Details
              </Link>
              <a href="#" className="btn btn-sm btn-link text-muted"></a>
            </div>
            <div className="mt-2"></div>
          </div>
        )
      })
      this.setState({list})
    }).catch(error => {
      console.log(error)
    })
  }

  componentDidMount(){
    this.getUsersArticles()
  }

  render(){
    const { isAuthenticated } = this.props
    return (
      <div className="content-page">
        <div className="content">
          <div className="container-fluid">
            <div className="row">
              <div className="col-12">
                <div className="page-title-box">
                  <h4 className="page-title">Articles</h4>
                </div>
              </div>
            </div>
            <div className="row">
              <div className="col-xl-9">
                <div className="card">
                  <div className="card-body">
                    {this.state.list}
                    <div className="text-center">
                      <a href="#" className="text-danger">
                        Load more 
                      </a>
                    </div>
                  </div>
                </div>
              </div>
              <div className="col-xl-3">
              </div>
            </div>
          </div>
        </div>
        {isAuthenticated &&
          <footer className="footer">
            <div className="container-fluid">
              <div className="row">
                <div className="col-md-6">
                  <script>document.write(new Date().getFullYear())</script>2021 Â© Code
                </div>
                <div className="col-md-3"></div>
              </div>
            </div>
          </footer>
        }
      </div>
    )
  }
}
function mapStateToProps(state) {
  const { auth } = state
  const { isAuthenticated } = auth
  return { isAuthenticated }
}
export default connect(mapStateToProps)(ArticlesList)
